Samurai Champloo (??????????, Samurai Chanpur??) is a sh?nen anime series consisting of twenty-six episodes. It was broadcast in Japan from May 20, 2004 through March 19, 2005 on the television network, Fuji TV. Samurai Champloo was created and directed by Shinichiro Watanabe, whose previous television show, Cowboy Bebop, earned him renown in the anime and Japanese television communities.[1] The show was produced by the Japanese animation studio, Manglobe, Inc.

